def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    for char in prefix:
        if char == '\n':
            if current_line.strip() and current_column < column:
                res = ''.join(lines)
                return res, prefix[len(res):]
            lines.append(current_line)
            current_line = ""
            current_column = 0
            wait_for_nl = False
        elif char == '\t':
            current_column += (4 - current_column % 4)
        else:
            current_line += char
            current_column += 1
            if char == ' ':
                current_column += 3  # assuming 4 spaces per tab
            wait_for_nl = True if char != ' ' else False
    return ''.join(lines), current_line
